【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ イオン濃度約3倍のターボ運転で消臭スピード2倍<br />ターボ運転時約20分、標準運転時約40分で部屋に染みついたタバコのニオイ成分を分解・除去し、気にならないレベルまで消臭します。<br /><br />★ USB電源<br />市販のUSB/AC変換アダプターやモバイルバッテリーを使えば、いつでもどこでもがさらに広がります。<br />※車用にUSBケーブル・カーアダプターを同梱<br /><br />★ 花粉キャッチ<br />車室内に舞い込んだ花粉を花粉キャッチフィルターが捕集します。<br /><br />★ 浮遊カビ菌を除菌<br />約31m3(約8畳相当)の試験空間での約83分後の効果です。<br /><br />★ 浮遊菌・浮遊ウイルスの作用抑制<br />浮遊菌の作用抑制:約31m3(約8畳相当)の密閉した試験空間での約14分後の効果です。<br />浮遊ウィルスの作用抑制:約25m3(約6畳相当)の密閉した試験空間での約66分後の効果です。<br /><br />★ 付着臭・付着カビ臭を分解・除去<br />付着臭を分解・除去:約3.5m3の試験空間にて吹き出し方向に約1mの位置にたばこのニオイ成分を付着させた布片を置いて試験機を運転。<br />標準運転時約40分後の消臭効果を6段階臭気強度表示法にて評価。<br />付着カビ臭を分解・除去:約3.6m3の車内空間での約45分後の効果です。<br />※付着しているニオイの種類・強さ・対象物の素材などによって、ニオイ除去効果は異なります。<br /><br />★ 静電気を抑制<br />約3.6m3の車内空間での約4分後の効果です。<br /><br />★ お肌にツヤ効果<br />約6畳相当の試験空間での約60分後の効果です。<br />※車室内を加湿するわけではありません。<br />※季節・周囲温度・湿度・風の流れなどや、設置場所使用時間・個人によって効果は異なります。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 定格入力: DC12V<br />* 定格出力: DC5V<br />* 運転モード: 弱、標準、ターボ<br />* 消費電力: [弱]0.5W、[標準]0.6W、[ターボ]1.9W<br />* 運転音: [弱]19dB、[標準]23dB、[ターボ]36dB<br />* 適用容積: 約3.6m3<br />* 寸法: 円筒形 上部直径 74mm 下部直径 65mm 高さ 162mm(USBケーブル・カーアダプターは除く)<br />* 質量: 約260g(USBケーブル・カーアダプターは除く)<br />* 付属品: USBケーブル(長さ1.5m)、カーアダプター</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
